UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'RAFE' THEN 0.6599999999999999 WHEN 'SLNZ' THEN 1.1600000000000001 WHEN 'METU' THEN 0.869 WHEN 'OALC' THEN 0.404 WHEN 'TBX' THEN 1.7580000000000002 WHEN 'SSUS' THEN 1.069 WHEN 'CSHI' THEN 0.849 WHEN 'ACVF' THEN 0.266 WHEN 'PREF' THEN 0.295 WHEN 'SFYX' THEN 0.374 WHEN 'PSC' THEN 0.396 WHEN 'TYD' THEN 0.756 WHEN 'LBAY' THEN 0.304 WHEN 'DUSA' THEN 2.262 WHEN 'DUG' THEN 1.698 WHEN 'IBIF' THEN 1.0270000000000001 WHEN 'HYBX' THEN 0.7999999999999999 WHEN 'AESR' THEN 0.06 WHEN 'TPIF' THEN 0.41899999999999993 WHEN 'PID' THEN 0.737
    END,
    updatedat = NOW()
    WHERE symbol IN ('RAFE', 'SLNZ', 'METU', 'OALC', 'TBX', 'SSUS', 'CSHI', 'ACVF', 'PREF', 'SFYX', 'PSC', 'TYD', 'LBAY', 'DUSA', 'DUG', 'IBIF', 'HYBX', 'AESR', 'TPIF', 'PID');